import React from 'react';
import ReactPlayer from 'react-player/lazy';

interface Skill {
    name: string;
    icon: string | JSX.Element;
}

interface ProjectData {
    id: number;
    title: string;
    subtitle: string;
    image: string;
    description: string;
    skills: Skill[];
    highlights?: string[];
    review: string;
    link?: string;
    video?: string;
}

export default function Project() {
    const projects: ProjectData[] = [
        {
            id: 1,
            title: '약매니저',
            subtitle: 'React Native 앱 개발 및 유지보수 (2년)',
            image: 'https://bangmim.github.io/pmh/img/pmh.jpg',
            description:
                '약국 및 의료기관을 위한 종합 관리 앱입니다. 2년간 개발 및 유지보수를 담당했으며, 현재 48,000명의 사용자가 이용하고 있습니다.',
            skills: [
                { name: 'React Native', icon: '' },
                { name: 'TypeScript', icon: '' },
                { name: 'iOS / Android', icon: '' },
                { name: 'Redux', icon: '' },
                { name: 'REST API', icon: '' },
                { name: 'Firebase', icon: '' },
            ],
            highlights: [
                '커뮤니티 - 댓글, 좋아요, 실시간 알림',
                '마약류 점검부 - 법적 요구사항 충족',
                '약국 관리 - 재고 및 통계 대시보드',
            ],
            review: '사용자 피드백을 받아 바로 개선하는 과정이 의미있었습니다. 사용자가 많다보니 성능과 안정성에 신경을 많이 썼고, TypeScript를 도입하면서 유지보수가 한결 수월해졌습니다. 배포부터 업데이트, 사용자 문의 대응까지 앱 운영 전반을 경험할 수 있었습니다.',
        },
        {
            id: 2,
            title: '약매니저 관리 웹',
            subtitle: 'React 기반 관리자 대시보드',
            image: 'https://bangmim.github.io/pmh/img/pmh.jpg',
            description:
                '약매니저 앱과 연동되는 관리자 대시보드입니다. 사용자 관리, 게시글 관리, 통계 확인 등 앱 운영에 필요한 기능들을 웹에서 관리할 수 있습니다.',
            skills: [
                { name: 'React', icon: '' },
                { name: 'TypeScript', icon: '' },
                { name: 'REST API', icon: '' },
                { name: 'Chart.js', icon: '' },
            ],
            highlights: ['사용자 관리 및 권한 설정', '콘텐츠 관리 시스템 (게시글, 댓글)', '실시간 통계 대시보드'],
            review: 'TypeScript를 도입하여 타입 안정성을 확보했고, Chart.js를 활용해 데이터 시각화 기능을 구현했습니다. 앱과 웹을 함께 개발하면서 전체적인 서비스 구조를 이해할 수 있었고, 효율적인 데이터 관리 방법을 배웠습니다.',
        },
    ];

    const learningProjects = [
        {
            title: '자동차 사고 다발 지역 조회',
            skills: 'React, Recharts, Kakao Map API',
            link: 'https://bangmim.github.io/projectIT/',
        },
        {
            title: 'MY쇼핑몰',
            skills: 'React, Tailwind CSS',
            link: 'https://bangmim.github.io/shopping/',
        },
    ];

    return (
        <div className="animate-slide-up">
            {/* 실무 프로젝트 */}
            <div className="mb-16">
                <h1 className="text-3xl font-bold text-gray-900 mb-8 pb-4 border-b-2 border-gray-900">
                    💼 실무 프로젝트
                </h1>
                <div className="space-y-16">
                    {projects.map((project) => (
                        <div key={project.id} className="section">
                            {/* 헤더 */}
                            <div className="mb-6">
                                <h2 className="text-2xl md:text-3xl font-bold text-gray-900 mb-2">{project.title}</h2>
                                <h3 className="text-xl text-gray-600 font-medium">{project.subtitle}</h3>
                            </div>

                            {/* 설명 */}
                            <div className="mb-6">
                                <p className="text-lg text-gray-700 leading-relaxed mb-4">{project.description}</p>

                                {/* 주요 기능 */}
                                {project.highlights && (
                                    <div className="mt-6">
                                        <h4 className="text-sm font-semibold text-gray-500 uppercase tracking-wider mb-3">
                                            주요 개발 기능
                                        </h4>
                                        <ul className="space-y-2">
                                            {project.highlights.map((highlight, index) => (
                                                <li key={index} className="flex items-start gap-2 text-gray-700">
                                                    <span className="text-gray-900 mt-1">•</span>
                                                    <span>{highlight}</span>
                                                </li>
                                            ))}
                                        </ul>
                                    </div>
                                )}
                            </div>

                            {/* 기술 스택 */}
                            <div className="mb-6">
                                <h4 className="text-sm font-semibold text-gray-500 uppercase tracking-wider mb-3">
                                    Tech Stack
                                </h4>
                                <div className="flex flex-wrap gap-2">
                                    {project.skills.map((skill, index) => (
                                        <div
                                            key={index}
                                            className="flex items-center gap-2 px-4 py-2 bg-gray-100 text-gray-800 font-medium hover:bg-gray-200 transition-colors duration-200"
                                        >
                                            <span className="text-lg">{skill.icon}</span>
                                            <span>{skill.name}</span>
                                        </div>
                                    ))}
                                </div>
                            </div>

                            {/* 프로젝트 회고 */}
                            <div className="p-6 bg-blue-50 border-l-4 border-blue-500">
                                <h4 className="text-blue-800 font-semibold mb-2 flex items-center gap-2">
                                    <span>💭</span>
                                    프로젝트 회고
                                </h4>
                                <p className="text-gray-800 leading-relaxed">{project.review}</p>
                            </div>

                            {/* 비디오 */}
                            {project.video && (
                                <div className="mt-6">
                                    <h4 className="text-lg font-semibold text-gray-900 mb-3 text-center">구현 영상</h4>
                                    <div className="overflow-hidden">
                                        <ReactPlayer
                                            url={project.video}
                                            width="100%"
                                            height="400px"
                                            playing={false}
                                            muted={false}
                                            controls={true}
                                            loop={true}
                                        />
                                    </div>
                                </div>
                            )}

                            {/* 링크 */}
                            {project.link && (
                                <a
                                    href={project.link}
                                    target="_blank"
                                    rel="noopener noreferrer"
                                    className="btn-minimal inline-flex items-center gap-2 mt-6"
                                >
                                    <span>프로젝트 보기</span>
